import image from "../../../assets/images/zigma_wave.svg";

const Sigma = () => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        justifyContent: "end",
        alignItems: "end",
      }}
    >
      <img src={image} alt="" />
    </div>
  );
};

export default Sigma;
